La possibilit√† di differenziare il carico specifico all‚Äôinterno della stessa parte calda, consente di raggiungere temperature diversificate in varie parti di un elemento. E‚Äô inoltre disponibile la tecnologia con parti fredde incorporate.
E‚Äô possibile acquistare il cavo gi√† tagliato a misura e finito secondo le proprie esigenze, oppure avvolto su bobina. A richiesta, pu√≤ essere anche completato con accessori: spine bipolari per collegamento, fascia con vite per applicazione a diverse dimensioni e modelli.
