<p><em>"Non siamo sicuri che le parole possono salvare delle vite, ma sappiamo con certezza che il silenzio uccide."¬†</em></p>[/rad_page_widget][/rad_page_container][/rad_page_section][rad_page_section id='rpsFV5BU54VCTMYMJVYR93O8XNUFPAQJ8QC' last='true' section_name='Section' v_padding='' classes='' visibility='None' background_opts='' background_color='' background_image='' background_position='' background_cover='' background_repeat='' background_attachment='' background_gradient_dir='' start_gr='' end_gr='#eeeeee' video_url='' border_top_width='0' border_top_color='' border_top_type='' border_bottom_width='0' border_bottom_color='' border_bottom_type='' ][rad_page_container id='rpcEGDP2ON8NOQQHOIBSR4WNNUO7JN17U12' layout='three_fourth' first='true' top='true' classes='' visibility='None;' float='auto_align' background_opts='' background_color='' background_opacity='' background_image='' background_position='' background_cover='' background_repeat='' background_attachment='' background_gradient_dir='horizontal' start_gr='' end_gr='#eeeeee' border_top_width='0' border_top_color='' border_top_type='' border_bottom_width='0' border_bottom_color='' border_bottom_type='' ][rad_page_widget id='rpwDRRHAJ9AAE70FNKJIUA0BD6G1R0M1NWT'  type='rad_text_widget' top='true' type='rad_text_widget' text_title=' ' text_subtitle=' ' rich_key='text_data' col_alignment='left' visibility='none' delay='' clear_float='no' icon='' icon_margin='5' icon_alignment='left' icon_animation='none' title_color='' subtitle_color='' text_color='' title_size='' title_w='' subtitle_size='' subtitle_w='' text_size='' cb_margin='' ct_margin='' tt_margin='' st_margin='' tet_margin='' rich_key='text_data' type='rad_text_widget' id='rpwDRRHAJ9AAE70FNKJIUA0BD6G1R0M1NWT' ]<p align="justify">Sedes Group, in qualit√† di ente socio-economico, contribuisce, con il proprio operato al progresso umano, civile e sociale.</p>
Il Gruppo, infatti,¬†da anni sostiene¬†attivamente le attivit√† della comunit√† brasiliana creata da Padre Vittorio a San Paolo (Brasile) e l‚ÄôAssociazione dei Medici Senza Frontiere. Entrambe le associazioni condividono l‚Äôobiettivo di sostenere, economicamente e moralmente, le popolazioni pi√π bisognose.
<p align="justify"><em>Fondata nel 1971 MFS opera, in circa 63 paesi al mondo, indipendentemente da qualsiasi bandiera politica, militare o religiosa (89% delle sue risorse proviene da finanziamenti privati). Ogni giorno quasi 27.000 professionisti sono al lavoro allo scopo di curare e alleviare le sofferenze di quelle popolazioni, la cui sopravvivenza √® minacciata da guerre, malnutrizione, esclusione dall‚Äôassistenza sanitaria o catastrofi naturali.</em></p>
